import './App.css';
import { AppCard } from './AppCard';
import pic1 from './img/pic1.jpg';
import pic2 from './img/pic2.jpg';
import pic3 from './img/pic3.jpg';
import pic4 from './img/pic4.jpg';
import pic5 from './img/pic5.jpg';
import pic6 from './img/pic6.jpg';

export function AppList(props) {
    return (
      <div className="grid">
        <AppCard onClick={() => props.setApplication('Click counter')} img={pic1} text={'Counter'}/>
        <AppCard onClick={() => props.setApplication('Click app')} img={pic2} text={'App-2'}/>
        <AppCard img={pic3} text={'App-3'}/>
        <AppCard img={pic4} text={'App-4'}/>
        <AppCard img={pic5} text={'App-5'}/>
        <AppCard img={pic6} text={'App-6'}/>
      </div>
    )
}
